import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { BodyComponent } from './Components/body/body.component';
import { KartComponent } from '../kart-module/Components/kart/kart.component';
import { KartModuleModule } from '../kart-module/kart-module.module';

const routes: Routes = [
  {
    path:"",
    component:BodyComponent,
  },
  {
    path:"kart",
    loadChildren:()=>import("../kart-module/kart-module.module").then(m=>m.KartModuleModule)
  }




];

@NgModule({
  imports: [RouterModule.forChild(routes),
  KartModuleModule],
  exports: [RouterModule]
})
export class HomeModuleRoutingModule { }
